import React from "react";

export default function index() {
  return (
    <div>
      <h1>当前求和为: 0</h1>
      <br />
      <select ref={c=>this.selectNum}>
        <option value="1">1</option>
        <option value="2">2</option>
        <option value="3">3</option>
        &nbsp;
        <button>+</button>&nbsp;
        <button>-</button>&nbsp;
        <button>当前求和为奇数再加</button>&nbsp;
        <button>异步加</button>
      </select>
    </div>
  );
}
